import './App.css';

function LoginSign() {
  return (
    <>
      <h1 className='logo'>Logo Goes Here</h1>
      <div className='buttons'>
          <button className="button1">Login</button>
          <button className='button2'>Sign Up</button>
      </div>
    </>
  );
}

export default LoginSign;
